import React from "react";  
import { useParams } from "react-router-dom"; 





function OpeningPage() { 
const { id } = useParams(); 

const opening = { 
    id, 
    name: "Difesa Siciliana", 
    moves: "1.e4 c5", 
    description: "Una delle difese più popolari contro 1.e4."

}; 

 return(
    <div>
        <h1>{opening.name}</h1>
      <p>Mosse iniziali: {opening.moves}</p>
      <p>{opening.description}</p>
    </div> 

 ); 



} 

export default OpeningPage;
